        <p>
          <h1 className="App-title"> Welcome to React</h1>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <class_based />
      </header>
    </div>
  );
}

export default App;
